{u'parts': [{u'text': u'El estudiante 1 del paso 1 al paso 2 no aplic\xf3 de buena manera la propiedad distributiva. Y luego, en el paso 3 aplic\xf3 una multiplicaci\xf3n, a\xfan cuando, el paso 2 corresponde a una adici\xf3n.

