{u'parts': [{u'text': u'Estudiante 1: Comenz\xf3 utilizando la propiedad distributiva de la multiplicaci\xf3n sobre la adici\xf3n, pero no multiplic\xf3 por el segundo t\xe9rmino (primer error). Luego al sumar 8a + b, sum\xf3 los coeficientes num\xe9ricos y "junt\xf3" las letras, cuando no eran t\xe9rminos semejantes (segundo error), adem\xe1s, para que el resultado quedara con parte literal ab tendr\xeda venir de una multiplicaci\xf3n (mezclo adici\xf3n y multiplicaci\xf3n)

